import React from "react";
import "./App.css";

import List from "./componets/List";

class App extends React.Component {
  state = {
    user1: [
      {
        text: "foo",
      },
      {
        text: "bar",
      },
      {
        id: 0,
      },
    ],
    user2: [
      {
        text: "foo",
      },
      {
        text: "bar",
      },
      {
        id: 1,
      },
      {
        text: "foo",
      },
    ],
    user3: [
      {
        text: "foo",
      },
      {
        text: "bar",
      },
      {
        id: 2,
      },
    ],
    user4: [
      {
        text: "foo",
      },
      {
        text: "bar",
      },
      {
        id: 3,
      },
    ],
    input: "",
    user1ID: 0,
    user2ID: 1,
    user3ID: 2,
    user4ID: 3,
  };

  moveToNext = (index) => {
    const state = this.state;
  };

  render() {
    return (
      <div className="App">
        <div className="container">
          <div>
            <div className="user1">
              <h2 className="name">Winnie</h2>
            </div>
            <List
              blocktext={this.state.user1}
              moveToNext={this.moveToNext}
              id={this.state.user1ID}
            />
          </div>
          <div>
            <div className="user2">
              <h2 className="name">Bob</h2>
            </div>
            <List
              blocktext={this.state.user2}
              moveToNext={this.moveToNext}
              id={this.state.user2ID}
            />
          </div>
          <div>
            <div className="user3">
              <h2 className="name">Thomas</h2>
            </div>
            <List
              blocktext={this.state.user2}
              moveToNext={this.moveToNext}
              id={this.state.user3ID}
            />
          </div>
          <div>
            <div className="user4">
              <h2 className="name">George</h2>
            </div>
            <List
              blocktext={this.state.user2}
              moveToNext={this.moveToNext}
              id={this.state.user4ID}
            />
          </div>
        </div>
      </div>
    );
  }
}

export default App;
